import React, { useState, useEffect } from "react";
import "./App.css";
import { Button, Container, Row, Col } from "react-bootstrap";
import axios from "axios";

function App(): JSX.Element {
    const [randomNumber, setRandomNumber] = useState<number>();

    useEffect(() => {
        // Fetch random number from the backend when the component mounts
        fetchData();
    }, []);

    const fetchData = () => {
        axios.get("http://localhost:3000/homepage")
            .then(response => {
                const { randomNumber } = response.data;
                setRandomNumber(randomNumber);
            })
            .catch(error => {
                console.error("Error:", error);
            });
    };

    const handleClick = () => {
        // Fetch random number from the backend when the button is clicked
        fetchData();
    };

    return (
        <div className="App">
            <h1>this is header text</h1>
            <header className="App-header">
                UD CISC275 with React Hooks and TypeScript
            </header>
            <p>
                Edit <code>src/App.tsx</code> and save. This page will
                automatically reload. Also im Alex Hoy, Hello World.
            </p>
            <Container>
                <Row>
                    <Col>
                        <div
                            style={{
                                height: "40px",
                                width: "30px",
                                backgroundColor: "red"
                            }}
                        ></div>
                    </Col>
                    <Col>
                        Why this bird is angry:
                        <ol>
                            <li>Eggs got taken</li>
                            <li>He is red</li>
                            <li>He is frowning</li>
                        </ol>
                        <div
                            style={{
                                height: "30px",
                                width: "40px",
                                backgroundColor: "red"
                            }}
                        ></div>
                    </Col>
                </Row>
            </Container>
            <Button onClick={handleClick}>
                Get Random Number from C++ Backend
            </Button>
            {randomNumber !== undefined && (
            <div>Random Number: {randomNumber}</div>
            )}
        </div>
    );
}

export default App;
